import React from 'react';
import '../../style/signUpSignIn.css';
import traineeBackground from '../../assets/traineeBackground.png';
import companyBackground from '../../assets/companyBackground.png';
import Nav from "../nav";

const routeSignUp = () => {
  return (
    <div>
    <Nav />
      <div className='container'> 
        <div className='row'>
        <a className='col-6' href="/StudentSignUp"><img className="img-fluid" src={traineeBackground} alt="" /></a>
        <a className='col-6' href="/TrainerSignUp"><img className="img-fluid" src={companyBackground} alt="" /></a>
        </div>       
      </div>
    </div>
  )
}

export default routeSignUp
